var tripleFive=function(){for(var o=0;3>o;o++)console.log("Five !")};console.log(tripleFive());var lastLetter=function(o){return o[o.length-1]};console.log(lastLetter("hello")),console.log(lastLetter("island"));var square=function(o){return o*o};console.log(square(3)),console.log(square(5));var negative=function(o){return-o};console.log(negative(5)),console.log(negative(-8));var toArray=function(o,e,n){return[o,e,n]};console.log(toArray(1,4,5)),console.log(toArray(8,9,10));var startsWithA=function(o){return"a"===o[0].toLowerCase()?!0:!1};console.log(startsWithA("aardvark")),console.log(startsWithA("bear"));var excite=function(o){return o+"!!!"};console.log(excite("yes")),console.log(excite("go"));var sun=function(o){return-1===o.indexOf("sun")?!1:!0};console.log(sun("sundries")),console.log(sun("asunder")),console.log(sun("catapult"));var tiny=function(o){return o>=0&&1>=o?!0:!1};console.log(tiny(.3)),console.log(tiny(14)),console.log(tiny(-5));var getSeconds=function(o){var e=o.split(":");return 60*e[0]+ +e[1]};console.log(getSeconds("01:30")),console.log(getSeconds("10:25"));